public class InnerConfigConfigDataFactory(Action<Humidifier.GroundStation.ConfigTypes.ConfigData> factoryAction = null) : SubResourceFactory<Humidifier.GroundStation.ConfigTypes.ConfigData>
{

    internal InnerConfigDataflowEndpointConfigFactory DataflowEndpointConfigFactory { get; set; }

    internal InnerConfigUplinkEchoConfigFactory UplinkEchoConfigFactory { get; set; }

    internal InnerConfigAntennaDownlinkConfigFactory AntennaDownlinkConfigFactory { get; set; }

    internal InnerConfigAntennaDownlinkDemodDecodeConfigFactory AntennaDownlinkDemodDecodeConfigFactory { get; set; }

    internal InnerConfigTrackingConfigFactory TrackingConfigFactory { get; set; }

    internal InnerConfigAntennaUplinkConfigFactory AntennaUplinkConfigFactory { get; set; }

    internal InnerConfigS3RecordingConfigFactory S3RecordingConfigFactory { get; set; }

    protected override Humidifier.GroundStation.ConfigTypes.ConfigData Create()
    {
        var configDataResult = CreateConfigData();
        factoryAction?.Invoke(configDataResult);

        return configDataResult;
    }

    private Humidifier.GroundStation.ConfigTypes.ConfigData CreateConfigData()
    {
        var configDataResult = new Humidifier.GroundStation.ConfigTypes.ConfigData();

        return configDataResult;
    }
    public override void CreateChildren(Humidifier.GroundStation.ConfigTypes.ConfigData result)
    {
        base.CreateChildren(result);

        result.DataflowEndpointConfig ??= DataflowEndpointConfigFactory?.Build();
        result.UplinkEchoConfig ??= UplinkEchoConfigFactory?.Build();
        result.AntennaDownlinkConfig ??= AntennaDownlinkConfigFactory?.Build();
        result.AntennaDownlinkDemodDecodeConfig ??= AntennaDownlinkDemodDecodeConfigFactory?.Build();
        result.TrackingConfig ??= TrackingConfigFactory?.Build();
        result.AntennaUplinkConfig ??= AntennaUplinkConfigFactory?.Build();
        result.S3RecordingConfig ??= S3RecordingConfigFactory?.Build();
    }

} // End Of Class

